INSERT INTO `component__field_book_description` VALUES ('book_detail','0','28','28','en','0','<h2>Choosing Courage: The Everyday Guide to Being Brave at Work</h2>\r\n\r\n<p class="standfirst font-large">An inspirational, practical, and research-based guide for embracing risk and making a powerful impact at work.</p>\r\n\r\n<p>Have you ever wanted to disagree with your boss in a meeting? Speak up about your company''s lack of diversity or unequal pay practices? Make a tough decision that you know will be unpopular?</p>\r\n\r\n<p>We all have opportunities to be courageous at work. But since courage requires risk—to our reputations, our social standing, and, in some cases, our jobs—we often fail to act, which leaves us feeling powerless and regretful for not doing what we know is right. There''s a better way to work and live—and <em>Choosing Courage</em> provides the moral imperative and research-based tactics to help you make better use of your courageous instincts at work.</p>\r\n\r\n<p>Doing for courage what Angela Duckworth has done for grit and Brene Brown for vulnerability, Jim Detert, the world''s foremost expert on workplace courage, explains that courage isn''t a character trait that only a few possess; it''s a virtue developed through practice. And, with the right attitude and approach, you can learn to hone it like any other skill and incorporate it into your everyday life.</p>\r\n\r\n<p>Full of stories of ordinary people who''ve acted courageously <em>Choosing Courage</em> will give you a fresh perspective on the power of voicing your authentic ideas and opinions. Whether you''re looking to make a mark, stay true to your values, act with more integrity, or simply want to grow as a professional, this is the guide you need to achieve greater impact at work.</p>\r\n','full_html');
INSERT INTO `component__field_book_quote` VALUES ('book_detail','0','28','28','en','0','<blockquote class="book__quote-text">“Jim Detert has produced an insightful, practical book on overcoming fear. Whether you sit at the top, middle, or bottom of an organization, <em>Choosing Courage</em> will help you find the nerve to stand up for your principles and build the skills to drive change.”</blockquote>\r\n\r\n<div class="book__quote-author">—Adam Grant</div>\r\n\r\n<div class="book__quote-author__details book__quote-author"><em>New York Times </em>bestselling author, <em>Think Again</em> and <em>Originals</em>; host, TED podcast <em>WorkLife with Adam Grant</em></div>\r\n','full_html');
INSERT INTO `component__field_chapter_link` VALUES ('book_detail','0','28','28','en','0','https://jimdetert.com/chapter1.pdf','Download the first chapter now!','a:0:{}');
INSERT INTO `component__field_description` VALUES ('banner_content','0','1','1','en','0','<p><small class="intro__quote-author"><em>Choosing Courage</em> provides the moral imperative and research-based tactics to help you speak up and stand out competently at work and in everyday life.</small></p>\r\n','full_html'),('featured_component_with_image','0','4','4','en','0','<div class="main-courage__text">\r\n<p class="standfirst">Choosing courage in key moments can protect others, help solve problems and avert disasters, lead to opportunities seized, and to various forms of innovation and growth.</p>\r\n\r\n<p>It can inspire commitment, bolster trust, and lead others to act more courageously. Choosing courage helps you build the legacy you want and avoid regrets you don’t want.</p>\r\n</div>\r\n\r\n<p class="main-courage__bold-italic">Are you ready to learn more and get started?</p>\r\n','full_html'),('configurable_text','0','5','5','en','0','<div class="narrow_width s_inner">\r\n<h2 class="large_heading">Defining Moments Curriculum</h2>\r\n\r\n<p class="standfirst font-large">One powerful way to explore what you (and others) would do in work situations requiring competent courage is to put yourself in the shoes of someone else facing a “defining moment.”</p>\r\n\r\n<p>Defining moments are workplace situations where people’s values and judgments are revealed when making and executing high-stakes decisions. Defining moments tend to have a disproportionate role in how we feel about ourselves and how others see us – they shape our legacies and also our (lack of) regrets.</p>\r\n\r\n<p>To help others learn from a powerful set of actual defining moments, Jim Detert has authored a series of short cases (generally just 1-2 pages). Each of these cases affords learners an opportunity to:</p>\r\n\r\n<ul class="dotted-list in_middle_of_text">\r\n	<li>consider their own instinctive reactions as a way to understand what’s most important to them and what skills they need to hone to successfully face the challenges associated those priorities, and</li>\r\n	<li>practice using the kinds of tools and skills that can help them navigate high-stress, emotional work experiences as competently as possible.</li>\r\n	<li>This is the third point</li>\r\n</ul>\r\n\r\n<p>To learn more about the kinds of situations covered in these defining moments so you can consider whether they might help you and others grow, please click the Learn More link below to see the abstracts for each on the Darden Business Publishing website.</p>\r\n</div>\r\n','full_html');
INSERT INTO `component__field_description` VALUES ('introduction_featured_content','0','7','7','en','0','<p>Jim is the John L. Colley Professor of Business Administration at the Darden Graduate School of Business Administration and a Professor of Public Policy at the Batten School of Leadership and Public Policy, both at the University of Virginia. His writing on workplace courage and related topics is grounded in decades of formal research and brought to life based on intimate portraits of leaders and ordinary people he’s come to know personally. Jim thrives on empowering people to have difficult conversations, engage rather than avoid challenging situations, and competently embrace other opportunities for courageous action in their own lives and workplaces.</p>\r\n','basic_html'),('featured_component_with_image','0','10','10','en','0','<h2 class="courage-link-zone-home__heading">Competent courage comes from careful practice.</h2>\r\n\r\n<div class="courage-link-zone-home__text">\r\n<p>Want to maximize your success when choosing courage in life and at work? The Courage Center brings together key insights from Jim’s research and his new book <em>Choosing Courage</em>. Embrace these steps to create more optimal outcomes for yourself and others.</p>\r\n</div>\r\n\r\n<h5>Find out how to:</h5>\r\n\r\n<ul class="dotted-list">\r\n	<li>Create the right conditions</li>\r\n	<li>Choose the right battles</li>\r\n	<li>Manage the message and your emotions</li>\r\n	<li>Follow-up effectively</li>\r\n</ul>\r\n\r\n<p>Speaking truth to power will look different based on whether you’re standing up to a boss, managing a subordinate or dealing with a difficult peer situation.</p>\r\n','full_html'),('detailed_contact_us','0','11','11','en','0','<p>While great leaders inspire me, I’m most impressed by people who do <em>not</em> have major power or limelight and yet <em>choose</em> to act courageously. I cheer for the underdog and appreciate the nonconformist who goes against the grain for a higher purpose. I’ve dedicated my career to studying and teaching about workplace courage – what it looks like, how it works, and why some people are able to demonstrate it more effectively than others.</p>\r\n\r\n<p>I believe systemic change is impossible without individual change from top to bottom in organizations. That’s why I focus on helping people honestly examine themselves —what drives them and holds them back, and what skills must they develop and personal commitments must they make if things are going to be different. When research-based theories are applied through innovative experiential learning, people build confidence in their ability to say and do the right things despite risk. <em>Choosing Courage </em> represents nearly two decades of learning how to help people on this journey. I’ve pulled together some of the key ideas and insights I’ve developed in this website.</p>\r\n\r\n<p>My wife Natalie and I live in Charlottesville, Virginia. We met in college at UW-Madison where I earned my BBA. She was my boss back then and she’s been my co-pilot in everything I’ve done since – including earning an MBA from the University of Minnesota, my MA and PhD at Harvard, and teaching at Penn State, Cornell, and now the University of Virginia. Our greatest achievement is the raising of two incredible young women – our daughters Laurel and Ellie.</p>\r\n\r\n<div class="grey_box">\r\n<h2 class="small_heading bold">I help individuals and institutions by:</h2>\r\n\r\n<ul class="dotted-list">\r\n	<li>Providing transformational experiential leadership development programs tailored to your needs;</li>\r\n	<li>Consulting with senior leadership teams to create structural and symbolic change; and,</li>\r\n	<li>Speaking and presenting on leadership topics related to competent courage, leadership, and ethics.</li>\r\n</ul>\r\n</div>\r\n','full_html');
INSERT INTO `component__field_description` VALUES ('sign_post_card','0','12','12','en','0','<p>Research-grounded thought leadership on competent courage and related leadership and ethics topics.</p>\r\n','full_html'),('sign_post_card','0','13','13','en','0','<p>A way for individuals and organizations to determine their current level of courageous action and opportunities for improvement.</p>\r\n','basic_html'),('sign_post_card','0','14','14','en','0','<p>Novel learning pedagogies and materials to support transformational learning.</p>\r\n','basic_html'),('sign_post_card_group','0','15','15','en','0','<h2 class="flush_with_top_of_letters section_title" style="text-align:center;">Jim’s Work</h2>\r\n\r\n<p class="standfirst">You can access the same insights, tools and pedagogies that Jim uses with students and organizations.</p>\r\n','full_html'),('configurable_text','0','17','17','en','0','<h2 class="large_heading text-align-center">Workplace Courage Acts Index (WCAI)</h2>\r\n\r\n<p class="standfirst font-large">Developed by Jim Detert and Evan Bruno, the Workplace Courage Acts Index (WCAI) helps individuals and organizations understand workplace courage in their own environment. Specifically, the WCAI asks respondents to evaluate how courageous certain behaviors are perceived to be in their own context and how frequently the behaviors happen there when opportunities arise.</p>\r\n\r\n<p>The WCAI is based in analyses of over 700 stories collected from a wide variety of respondent types (e.g., those varying widely in age, work experience, national origin, job type, job level). These stories, and subsequent data collections, led to the defining and refining of labels for a set of behaviors that are commonly seen as courageous in workplaces of all types.</p>\r\n\r\n<p>What behaviors? Overall, there are 35 behaviors assessed on the WCAI, organized into four shorter surveys covering acts involving:</p>\r\n\r\n<ul class="dotted-list in_middle_of_text">\r\n	<li>Higher-ups (<strong>Truth to power</strong>)</li>\r\n	<li>Those at the same level or below the actor in the hierarchy (<strong>Confront peers and subordinates</strong>)</li>\r\n	<li>External parties (<strong>Principled engagement with stakeholders</strong>)</li>\r\n	<li>The self (<strong>Bold personal actions</strong>)</li>\r\n</ul>\r\n\r\n<p>When you complete each of the surveys, you’ll be able to see and print a free report that shows you how you responded to each question and how your responses compare to every individual who has completed that survey.</p>\r\n','full_html');
INSERT INTO `component__field_description` VALUES ('intro_text_with_cta','0','18','18','en','0','<p>To help the research team continue to learn more about workplace courage, you’ll be asked to log in to the survey and answer a few demographic questions before beginning the courage surveys. This is all that is asked in return for making the surveys and individual report free.&nbsp;<strong>Note:</strong>&nbsp;This information is used strictly for research purposes. Your identity or individual responses will NEVER be revealed to anyone. Your data are secure, and will NEVER be sold or shared.</p>\r\n','basic_html'),('configurable_text','0','20','20','en','0','<h2 class="large_heading">Defining Moments Curriculum</h2>\r\n\r\n<p class="standfirst font-large">One powerful way to explore what you (and others) would do in work situations requiring competent courage is to put yourself in the shoes of someone else facing a “defining moment.”</p>\r\n\r\n<p>Defining moments are workplace situations where people’s values and judgments are revealed when making and executing high-stakes decisions. Defining moments tend to have a disproportionate role in how we feel about ourselves and how others see us – they shape our legacies and also our (lack of) regrets.</p>\r\n\r\n<p>To help others learn from a powerful set of actual defining moments, Jim Detert has authored a series of short cases (generally just 1-2 pages). Each of these cases affords learners an opportunity to:</p>\r\n\r\n<ul class="dotted-list in_middle_of_text">\r\n	<li>consider their own instinctive reactions as a way to understand what’s most important to them and what skills they need to hone to successfully face the challenges associated those priorities, and</li>\r\n	<li>practice using the kinds of tools and skills that can help them navigate high-stress, emotional work experiences as competently as possible.</li>\r\n</ul>\r\n\r\n<p>To learn more about the kinds of situations covered in these defining moments so you can consider whether they might help you and others grow, please click the Learn More link below to see the abstracts for each on the Darden Business Publishing website.</p>\r\n','full_html');
