INSERT INTO `node_revision__body` VALUES ('article','0','6','38','en','0','<p>Raising issues about racial injustice at work takes courage and brings risk for anyone — but especially for Black employees. Jim and co-author Laura Morgan Roberts show that you can speak up more effectively, and offer five strategies to mitigate those risks.</p>\r\n','','basic_html');
