INSERT INTO `search_dataset` VALUES ('8','en','node_search',' page not found page not found actadigital wed 6302021 340  oops we can not find that page ','0'),('9','en','node_search',' book book actadigital thu 7012021 29 download the first chapter now  preorder out may 2021 amazon barnes and noble walmart indiebound  jim detert has produced an insightful practical book on overcoming fear whether you sit at the top middle or bottom of an organization  choosing courage will help you find the nerve to stand up for your principles and build the skills to drive change adam grant new york times bestselling author  think again and originals  host ted podcast worklife with adam grant choosing courage the everyday guide to being brave at work an inspirational practical and researchbased guide for embracing risk and making a powerful impact at work have you ever wanted to disagree with your boss in a meeting speak up about your company s lack of diversity or unequal pay practices make a tough decision that you know will be unpopular we all have opportunities to be courageous at work but since courage requires risk to our reputations our social standing and in some cases our jobs we often fail to act which leaves us feeling powerless and regretful for not doing what we know is right there s a better way to work and live and choosing courage provides the moral imperative and researchbased tactics to help you make better use of your courageous instincts at work doing for courage what angela duckworth has done for grit and brene brown for vulnerability jim detert the world s foremost expert on workplace courage explains that courage isn t a character trait that only a few possess it s a virtue developed through practice and with the right attitude and approach you can learn to hone it like any other skill and incorporate it into your everyday life full of stories of ordinary people who ve acted courageously choosing courage will give you a fresh perspective on the power of voicing your authentic ideas and opinions whether you re looking to make a mark stay true to your values act with more integrity or simply want to grow as a professional this is the guide you need to achieve greater impact at work competent courage comes from careful practice want to maximize your success when choosing courage in life and at work the courage center brings together key insights from jim s research and his new book choosing courage  embrace these steps to create more optimal outcomes for yourself and others find out how to  create the right conditions choose the right battles manage the message and your emotions followup effectively speaking truth to power will look different based on whether you re standing up to a boss managing a subordinate or dealing with a difficult peer situation what s your next step  visit the courage center and begin your journey get started now  ','0');
